import React from "react";
import { Row, Col, Button, Typography, Progress } from "antd";
import { useRouter } from "next/router";
import { useSelector } from "react-redux";
const { Text, Paragraph } = Typography;

import {
	halfCol,
	fullCol,
	HeightImg,
	WidthImg,
	Texty,
} from "../../assets/css/style_result";
import Feature from "../../components/Feature";

const End = () => {
	const router = useRouter();

	const toTop = () => {
		router.push("/");
	};

	return (
		<>
			<Row justify="center">
				<Texty top={5} font={15}>
					나의 유형은
				</Texty>
			</Row>
			<Row justify="center">
				<Text
					strong
					style={{
						textAlign: "center",
						display: "block",
						marginTop: "5px",
						fontSize: "25px",
					}}
				>
					(여기에 유형 입력)
				</Text>
			</Row>
			<Row justify="center">
				<Text
					strong
					style={{
						textAlign: "center",
						display: "block",
						marginTop: "5px",
						fontSize: "30px",
						color: "#be2edd",
					}}
				>
					ENTP
				</Text>
			</Row>
			<Row>
				<img
					style={{
						display: "block",
						margin: "30px auto 30px auto",
						width: "200px",
						height: "auto",
					}}
					src={require("../../assets/dog.png")}
				/>
			</Row>

			<Feature title={"애정표현력"} value={40} />
			<Feature title={"눈치력"} value={40} />
			<Feature title={"썸추진력"} value={60} />
			<Feature title={"19금력"} value={40} />
			<Feature title={"마이웨이력"} value={100} color={"#eb4d4b"} />

			<Row justify="center">
				<Col {...fullCol}>
					<Paragraph
						strong
						style={{
							textAlign: "center",
							display: "block",
							marginTop: "45px",
							marginBottom: "45px",
							fontSize: "15px",
						}}
					>
						당신은 이러이러한 사람이에요.
						~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
					</Paragraph>
				</Col>
			</Row>

			<Row justify="center">
				<Col {...halfCol}>
					<Row>
						<Button type="link" style={{ height: "100%" }}>
							<Row>
								<WidthImg
									src={require("../../assets/cat.png")}
								/>
							</Row>
							<Row justify="center">환상유형</Row>
						</Button>
					</Row>
					<Row justify="center">
						<Text>환상의 케미</Text>
					</Row>
				</Col>
				<Col xs={3} sm={3} md={3} lg={3} xl={3}></Col>
				<Col {...halfCol}>
					<Row>
						<Button type="link" style={{ height: "100%" }}>
							<Row>
								<WidthImg
									src={require("../../assets/cat.png")}
								/>
							</Row>
							<Row justify="center">환장유형</Row>
						</Button>
					</Row>
					<Row justify="center">
						<Text>환장의 케미</Text>
					</Row>
				</Col>
			</Row>

			<Row justify="center">
				<Col xs={9} sm={9} md={4} lg={4} xl={4}>
					<Button
						style={{
							display: "block",
							marginTop: "40px",
							width: "100%",
							height: "40px",
						}}
						onClick={toTop}
					>
						처음으로
					</Button>
				</Col>
				<Col xs={2} sm={2} md={1} lg={1} xl={1}></Col>
				<Col xs={9} sm={9} md={4} lg={4} xl={4}>
					<a
						href="/assets/screenshot.png"
						download
						style={{
							display: "block",
							marginTop: "40px",
							width: "100%",
							height: "40px",
						}}
					>
						<HeightImg src={require("../../assets/download.png")} />
					</a>
				</Col>
			</Row>

			<Row style={{ height: "200px" }}></Row>
		</>
	);
};

export default End;

